import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { JanuaryComponent } from './month/01_january/january.component';
import { FebuaryComponent } from './month/02_febuary/febuary.component';
import { MarchComponent } from './month/03_march/march.component';
import { MonthComponent } from './month/month.component';
import { AprilComponent } from './april/april.component';

@NgModule({
  declarations: [
    AppComponent,
    JanuaryComponent,
    FebuaryComponent,
    MarchComponent,
    MonthComponent,
    AprilComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
